import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { CartProvider } from "./Components/Cart/CartContext";
import Login from "./Components/Auth/Login";
import Registration from "./Components/Auth/Register";
import Home from "./Components/Home/Home";
import Navbar from "./Components/Layout/Navbar";
import Profile from "./Components/User/Profile";
import Product from "./Components/StoreOwner/ProductPage";
import ProductDetail from "./Components/ProductDetail/ProductDetail";
import CartPage from "./Components/Cart/CartPage";
import CheckoutPage from "./Components/Checkout/Checkout";
import LoginPage from "./Components/Auth/Loginpage";
import { PayPalScriptProvider } from "@paypal/react-paypal-js";
import PaymentSuccess from './Components/Checkout/PaymentSuccessPage';
import PaymentFailure from './Components/Checkout/PaymentFailurePage';
function App() {
    return (
        <PayPalScriptProvider options={{ "client-id": "AXMl8juZd5UdMn3fqYuNTSH_NztoHa-mGVK0rlKY_lg6EnyIQE5_UA2osf0EwgVoyeNGMUNjYK6960QQ" }}>
            <BrowserRouter>
                <Navbar/>
                <CartProvider>
                        <Routes>
                            <Route path="/" element={<Home />} />
                            <Route path="/login" element={<Login />} />
                            <Route path="/register" element={<Registration />} />
                            <Route path="/profile" element={<Profile />} />
                            <Route path="/products" element={<Product />} />
                            <Route path="/products/:productId" element={<ProductDetail />} />
                            <Route path="/cart" element={<CartPage/>}/>
                            <Route path="/checkout" element={<CheckoutPage/>}/>
                            <Route path="/paymentsuccess" element={<PaymentSuccess/>}/>
                            <Route path="/paymentFailure" element={<PaymentFailure/>}/>
                            <Route path="/checkout" element={<CheckoutPage/>}/>

                            <Route path="/loginviagg" element={<LoginPage/>}/>
                        </Routes>
                </CartProvider>
            </BrowserRouter>
        </PayPalScriptProvider>

    );
}

export default App;
